package com.codershop.shoppinganywhere.common.entity;import java.util.Date;public class Permission {    private static final long serialVersionUID = 1L;    private Integer permissionId;    private Integer groupId;    private Integer menuId;    private Integer privilegeId;    private String status;    private Date updateTime;    public Integer getPermissionId() {        return permissionId;    }    public void setPermissionId(Integer permissionId) {        this.permissionId = permissionId;    }    public Integer getGroupId() {        return groupId;    }    public void setGroupId(Integer groupId) {        this.groupId = groupId;    }    public Integer getMenuId() {        return menuId;    }    public void setMenuId(Integer menuId) {        this.menuId = menuId;    }    public Integer getPrivilegeId() {        return privilegeId;    }    public void setPrivilegeId(Integer privilegeId) {        this.privilegeId = privilegeId;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }}